Defendant Kelly S Renfro in court with attorney Katie B. Bricco.   Kristie Gordon appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count 2 and Count 4.  Court strikes the repeater and finds defendant guilty.  Counts #1 and #3 are dismissed and read in.
The Defendant was sentenced as follows:

COUNT #2:
JAIL: 9 MONTHS (concurrent to 16CF414)
COSTS: $243.00 (apply cash bail);
DNA SURCHARGE: $200.00 (apply cash bail and balance to be paid as a condition of extended supervision on 16CF414);
  Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

Count #4:
JAIL: 9 MONTHS (concurrent to count #2 & 16CF414)
COSTS: $253.00 (to be paid as a condition of extended supervision on 16CF414);
DNA SURCHARGE: $200.00 (apply cash bail and balance to be paid as a condition of extended supervision on 16CF414);
  Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
